import "./App.css";
import Header from "./Header.js";
import Footer from "./Footer.js";

const name = "Pravesh Chand";
const time = 2020;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />

        {/* Hello World {name}. I started my HTML coding at {time}
          <p>I made my first page {2022 - time} years ago</p> */}
      </header>

      <footer className="App-footer">
        <Footer />
      </footer>
    </div>
  );
}

export default App;
